import './Prompt.css';

const Prompt = ({prompt}) => {
    const formattedPrompt = prompt.map(p => {
        return (
            <h4>p.title</h4>
        )
    })

    return (
        <div className='promptContainer'>
            {formattedPrompt}
        </div>
    )
}

export default Prompt;
